    "2016-04-19T02:28:39.060942",nt"name": "heat-rate",nt"isopen": false,nt"url":
    null,nt"notes": "The heat rate is the number of British Thermal Units (BTU)
    needed to produce a kilowatt-hour (kWh) of electricity. In other words, the average
    heat rate is a measurement of how efficiently a generating unit converts fuel into
    electricity. The lower the heat rate, the higher the efficiency. n nThe system average
    heat rate will vary somewhat year-to-year due to a number of factors including outages
    and market conditions. The approximately one percent increase for FY 2012 was primarily
    due to lower demand and lower natural gas prices which resulted in lower dispatch
    of Fayette Power Project (FPP). The reduced levels of production mean that units
    operated at lower, less efficient levels.",nt"license_title": "License Not
